import { Link } from 'react-router-dom';

function Edit() {
    <section className="edit__nav">
        <Link to='edit/classes' className="edit__link">Аудитории</Link>
        <Link to='edit/classes' className="edit__link">Группы</Link>
        <Link to='edit/classes' className="edit__link">Преподаватели</Link>
        <Link to='edit/classes' className="edit__link">Студенты</Link>
        <Link to='edit/classes' className="edit__link">Пользователи</Link>
    </section>
}

export default Edit;
